const migrationToolStyle = theme => ({
  migrationTool: {
    marginTop: "30px"
  },
  cardHeader: {
    color: "white",
    backgroundColor: "#FF645C",
    hight: "20px",
    textAlign: "center"
  },
  button: {
    marginBottom: "1em",
    height: "50px"
  },
  rightIcon: {
    marginLeft: theme.spacing.unit * 2,
  },
  content: {
    color: '#153255'
  },
  red: {
    color: '#CE4737'
  },
  green: {
    color: '#51A009'
  }
});

export default migrationToolStyle;
